VALUES ('3700446412128', 'Cone framboise', 'Sorbet à la framboise 45,6% : Eau, purée de framboise 15,9%, sucre, jus concentré de sureau, jus co centré de citron, protéines laitières, gélifiants : gomme xanthane et gomme guar, colorants : rouge de betterave et caroté oïdes, arôme naturel. Crème glacée façon crème fouettée 20,3% : Eau, écrémé reconstitué, crème 2,8%, .sucre, sirop de glucose-fru tose, lactose et protéines de lait, sirop de glucose, arôme naturel, émulsifiants : mono - et diglycérides d\'acides gras et e ters lactiques de mono - et diglycérides d\'acides gras, gélifiants farine de graines de caroube et gomme Gaufrette 14% : Farine de blé, sucre, graisse de coprah, émulsifiant : lécithine de soja, sel. Sauce aux fruits rouges 8,8% : Purée de fruits rouges 3,9% (purée de fraise, purée de framboise, purée de myrtille, jus de cassis 0,6%), sucre, sirop de glucose-fructose, eau, sirop de sucre inverti, amidon modifié, gélifiants : gomme xanthane et farine de graines de caroube, acidifiant : acide citrique, colorant : anthocyanes, correcteur d\'acidité . citrates de sodium, extraits de curcuma et d\'hibiscus. Chemisage au cacao maigre 8,1% : Graisse de coprah, sucre, cacao maigre en poudre 0,7%, émulsifiant : lécithine de soja. Pépites au cassis 2,5% : Jus de cassis 0,7%, sucre, dextrose, pomme, fibres d\'ananas, arôme naturel, gélifiant : alginate de sodium, stabilisant : phosphates de calcium, correcteurs d\'acidité : citrates de potassium et acide citrique, jus concentré de sureau. Morceaux de meringue enrobés de beurre de cacao 0,7% : Meringue 0,5% (sucre, blanc d\'?uf, amidon de.blé), beurre de cacao 0,1%, sucre. Pourcentages exprimés sur l\'ensemble du produit. Peut contenir des traces d\'arachides et de fruits à coque. Conservation', 'https://static.openfoodfacts.org/images/products/370/044/641/2128/front_fr.11.400.jpg', '6.2', '5.2', '38', '30', '1.3', '1.7', '0.12', '0.047244094488189', '', '0');

