VALUES ('3700477661205', 'Pizza a la grecque', 'Garniture* 58% : Houmous de pois chiches 26% (pois chiches* hydratés 14 % (eau, pois chiches&quot;, sel), huile d\'olive* vierge extra, eau, purée de citron*, cumin*, sel), MOZZARELLA*, poivrons* 10% , FETA* AOP 4,7%, oignons* rouges 2,4%, olives* 1,4% Pâte à pizza aux graines* 42% : farine de BLE*, eau, graines de pavot* 0,7%, huile d\'olive* vierge extra, graines de lin* 0,6% , graines de millet* 0,6%, graines de tournesol* 0,5%, sel, levure bou langère*. Pourcentage exprimé sur le produit total. &quot;Ingrédients issus de l\'Agriculture Biologique. Fabriqué dans un atelier qui utilise des crustacés, oeufs, poissons, soja, fruits à coque, céleri, moutarde, sulfites. Source de fibres et de protéines', 'https://static.openfoodfacts.org/images/products/370/047/766/1205/front_fr.14.400.jpg', '13', '5.7', '23', '2.3', '3.4', '9', '1.2', '0.47244094488189', '', '0');

