INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3700478514463', 'French Macaroons', 'Sucre, sucre glace, amandes 17%, blanc d\'œuf, pâte d\'amande (amandes, sucre, eau), beurre (lait), caramel au beurre salé 2.9% (sucre, crème (lait), beurre salé (lait), sirop de glucose, fleur de sel, poudre de vanille Bourbon), praliné pistache 2.9% (pistache, sucre), lait, chocolat noir 2.5% (pâte de cacao, sucre, beurre de cacao, vanille naturelle), brisure de framboise 2.4%, eau, purée de citron 1.5%, crème (lait), noisettes, chocolat au lait (sucre, poudre de lait, beurre de cacao, pâte de cacao, émulsifiant : lécithine de soja, vanille naturelle), sirop de glucose, pistaches, sirop de sucre inverti, cacao maigre en poudre, cacao en poudre, jaune d\'œuf, gélifiant : pectine, vanille Tahiti 0.1%, zeste de citron 0.1%, poudre à crème (amidon modifié de maïs, amidon de maïs), spiruline, fécule de pomme de terre, vanille Bourbon 0.05%, colorants : El 62, E150a, El 00, arômes : citron, pistache. Allergènes : CONTIENT fruits à coques (amandes, pistaches, noisettes), œufs et ovo-produits, lait et produits laitiers, soja et produits dérivés. Présence éventuelle de céréales contenant du gluten, graines de sésame, autres fruits à coques. Conservation : A conserver 72h maximum entre 0 et +40C après décongélation. A conserver à -180C. Ne jamais recongeler un produit décongelé. UTILISATION : Laisser décongeler 1 heure entre 0 et +40C avec le film plastique. Retirer le film plastique et déposer les macarons sur un plat. Servir.', '', '22.3', '5.3', '49.7', '48.4', '4.1', '8.8', '0.15', '0.0590551181102362', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3700478515941', '24 Petits fours sucrés de tradition', 'Sucre, beurre (lait), purée d\'abricot 6,5% (abricot, sucre, antioxydant : acide ascorbique), chocolat de couverture noir (58% de cacao) 6,2% (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de soja), farine de blé (gluten), poudre d\'amandes, biscuit joconde 5,1% (eufs entiers, sucre, farine de blé (gluten), eau, poudre d\'amande, farine de pois, poudre à lever : diphosphates-carbonates de sodium (contient amidon de blé (gluten)), émulsifiant : mono et diglycérides d\'acide gras, fécule de pomme de terre, protéines de lait), crème (crème de lait, stabilisant : carraghénanes), purée de framboise 4,1% (framboise, sucre), brisures de framboise 4,1%, blancs d\'eufs, nappage (eau, sirop de glucose, sucre, gélifiant : pectine, acidifiant : acide citrique), oeufs entiers, purée de fraise Mara des bois 2,8% (fraise, sucre), cube de fraise 2,7%, eau, framboise 2,1%, purée de fraise 2% (fraise, sirop de sucre), chocolat de couverture noir (72% de cacao) 2% (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de soja, arôme naturel de vanille), sucre roux, lait demi-écrémé, beurre de cacao, jus de citron 1,1% (eau, jus de citron concentré), cube de fraise semi-confit 0,8 % (fraise, sirop de glucose-fructose, eau, sucre, correcteur d\'acidité : acide citrique, épaississant : gomme xanthane, arôme naturel), jaune d\'oeufs, fécule de pomme de terre, gélifiant : pectines (stabilisant:diphosphates, phosphates de calcium), huile de tournesol, zeste de citron jaune 0,3%, chocolat noir (62% cacao) 0,3% (pâte de cacao, sucre, poudre de cacao maigre, émulsifiant : lécithine de soja, arôme naturel de vanille), sirop de glucose, préparation en pâte de pistache 0,2% (sucre, huile de tournesol, pâte d\'amande, pâte de pistache, arôme naturel, colorants : extraits végétaux d\'ortie et d\'épinard, extrait de curcuma), café 0,2 %, extrait de café 0,2% (café, eau, sucre), préparation gélifiante (gélatine de poisson, maltodextrine pomme de terre), chocolat de couverture au lait 0,1% (sucre , poudre de lait entier, beurre de cacao, pâte de cacao, émulsifiant : lécithine de soja, arôme naturel de vanille), sucre inverti, bille de céréale enrobée de chocolat noir (chocolat (sucre, pâte de cacao, beurre de cacao, matière grasse laitière anhydre (lait), émulsifiant : lécithine de soja, arôme naturel de vanille), céréales croustillantes (farine de blé (gluten), sucre, farine de malt de blé (gluten), amidon de blé (gluten), poudre à lever carbonates de sodium, sel, beurre de cacao, arôme naturel de vanille), sucre, sirop de glucose, agent d\'enrobage : gomme arabique, amidon modifié, graisse de noix de coco), pistache hachée 0,1%, colorants : caramel ordinaire - extrait d\'épinard et d\'ortie - curcuma, poudre à lever (amidon de blé (gluten), diphosphate, carbonates de sodium), épaississant : gomme xanthane, arôme naturel de vanille. Allergènes: CONTIENT céréales contenant du gluten, lait et produits laitiers, oeufs et ovo-produits, soja et produits dérivés, fruits à coques (amandes, pistaches), poisson. Présence éventuelle de crustacés, sésame, céleri, moutarde, mollusque, lupin, arachide, sulfites et autres fruits à coque. Conservation. A conserver 24 h maximum entre 0 et +4°C après décongélation.', 'https://static.openfoodfacts.org/images/products/370/047/851/5941/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3700478532399', 'Le Sablé Citron Meringué', 'Sablé 32,6 % (farine de _blé_ (_gluten_, poudre d\'_amandes_, sucre, sucre roux, _beurre_ (_lait_), _œufs_ entiers, sucre, jus de citron à base de concentré 11,1 %, meringue 10,9 % (sucre, blancs d\'_œufs_ (stabilisants : gomme guar (E412-gomme xanthane (E415), eau, préparation gélifiante (gélatine de _poisson_, maltodextrine de pomme de terre)), _beurre_ (_lait_), nappage (eau, sirop de glucose-fructose, sucre. gélifiants : pectine (E440, acidifiant acide citrique (E300)), préparation gélifiante (gélatine de _poisson_, maltodextrine de pomme de terre), _amande_, fécule de pomme de terre, zeste d\'orange zeste de citron.', '', '17.5', '8.3', '39.7', '34', '', '7.3', '0.1', '0.0393700787401575', '', '0');

